const Footer = () => {
    return (
        <footer className="">
            <hr/>
            <div className='foot'>
                <p className='fw-bold text-center'>Made with ❤️ by Surya.</p>
                <a href="https://www.flaticon.com/free-icons/movie-camera" className="text-center" title="movie camera icons">Movie camera icons created by Freepik - Flaticon</a>
                <a href='https://www.freepik.com/vectors/no-data' className="pb-4 text-center">No data vector created by storyset - www.freepik.com</a>
            </div>
        </footer>
    )
}

export default Footer;
